from musicdb.albumoftheyear import MusicDBParamsimport dbparseimport inspectfrom dbparse import MergeFileTypedef test_mergemap():    mdbparams = MusicDBParams()    for mergeName, mergeType in mdbparams.mergeMap.items():        assert isinstance(mergeType, MergeFileType), f'mergeName [{mergeName}] does not have a MergeFileType'                mergeClassName = getattr(mergeType, "mergeClassName")        assert isinstance(mergeClassName, str), "No merge class name is set!"                mergeClass = getattr(dbparse, mergeClassName)        assert inspect.isclass(mergeClass), f"No merge class with name [{mergeClassName}]"                mergeFunc = getattr(mergeClass, "merge")        assert callable(mergeFunc), f"merge() from {mergeClassName} is not a callable"         if __name__ == "__main__":    test_mergemap()